    function addBalance(address party, uint256 amount) external;

    function addTotalSupply(uint256 amount) external;

    function requestTransfer(
        address receiver,
        uint256 tokens
    ) external returns (bool);

    function requestTransaction(
        uint256 amount,
        address payer,
        bytes32 currency,
        address cashContract
    ) external returns (bool);
}

